import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  background-color: #fff;
  padding: 15px 10px;

  & input {
    border: none;
  }

  & input:focus {
    outline: none;
  }

  & input::placeholder {
    font-weight: 500;
  }
`;
export default function FormInput() {
  return (
    <Div>
      <label htmlFor="">
        <i class="fa fa-bed"></i>
        <input type="text" placeholder="Where are you going?" />
      </label>
      <input type="date" />
      <input type="text" />
    </Div>
  );
}
